import React from 'react';
import Calendar from 'react-calendar'
import Button from './components/Button';
import 'react-calendar/dist/Calendar.css';


function MyButton() {
  return (
    <button>
      I'm a button
    </button>
  );
}

class Header extends React.Component{
  render(){
    return (<header className=''>{this.props.titel}
    <Button/>
    <Button text="work"/>
    </header>)
  }
}


class App extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            helpText: "Help_text",
            userData: ""
        }

        this.inputClick = this.inputClick.bind(this)
    }


    componentDidUpdate(prevProp){
        if(this.state.helpText !== "Help")
            console.log("you change state")
    }
    helpText = "It work"
    render() {
        return (
        <div>
        <h1>{this.state.helpText}</h1>
        <h1>{this.state.userData}</h1>
        <MyButton />
        <Calendar />
        <Header titel = "my text"/>
        <input onClick={this.inputClick} onChange={event => this.setState({userData: event.target.value})}/>
        </div>)
    }
   inputClick(){
    this.setState({helpText:"changed"})
    console.log("Cliked")
   }
}


export default App
